import React from "react";

import { Button, Grid } from "@mui/material";

export const Rightnav = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={2}>
        <Button variant="outlined" fullWidth>
          Add Customer
        </Button>
      </Grid>
    </Grid>
  );
};
